			var btn = $(""<a>"").attr(""href"", ""#/jobs/history/"" + id + ""/"" + destPage);
			var ihtml = $(""<span>"");
			var c = """";
			switch (label) {
				case ""prev"":
					ihtml.addClass(""fa fa-fw fa-chevron-left"");
					if (pageNumber <= 1) {
						c = ""hide"";
					}
					break;
				case ""next"":
					ihtml.addClass(""fa fa-fw fa-chevron-right"");
					if (pageNumber >= pageCount) {
						c = ""hide"";
					}
					break;
				default:
					ihtml.text(destPage);
					if (pageNumber == destPage) {
						c = ""active"";
					}
					break;
			}

			btn.append(ihtml);
			return li.append(btn).addClass(c);
		},
